import { Layout, Avtar } from "antd";
const { Header, Footer, Slider, Content } = Layout;
import utilCss from "../styles/app.module.css";

export default function home() {
  return (
    <>
      <Layout>
        <Header>
            <Avtar src="./"/>
        </Header>
      </Layout>
    </>
  );
}
